import React from 'react';

const SmartPasscode = ({ passcode, onRevoke, onDelete }) => {
  return (
    <div style={card}>
      <strong>Lease:</strong> {passcode.lease_id} <br />
      <strong>User:</strong> {passcode.user_id} <br />
      <strong>Code:</strong> {passcode.passcode} <br />
      <strong>Expires:</strong> {passcode.expires_at} <br />
      <strong>Status:</strong> {passcode.is_active ? 'Active' : 'Revoked'}

      <div style={actions}>
        {passcode.is_active && (
          <button style={btnRevoke} onClick={() => onRevoke(passcode.passcode_id)}>
            Revoke
          </button>
        )}
        <button style={btnDelete} onClick={() => onDelete(passcode.passcode_id)}>
          Delete
        </button>
      </div>
    </div>
  );
};

/* ðŸŽ¨ Styles */
const card = { background: '#fff', padding: '1rem', borderRadius: '8px', boxShadow: '0 1px 4px rgba(0,0,0,0.08)', marginBottom: '1rem' };
const actions = { display: 'flex', gap: '0.5rem', marginTop: '0.75rem' };
const btnRevoke = { background: '#f39c12', color: '#fff', border: 'none', padding: '0.4rem 0.8rem', borderRadius: '4px', cursor: 'pointer' };
const btnDelete = { background: '#e74c3c', color: '#fff', border: 'none', padding: '0.4rem 0.8rem', borderRadius: '4px', cursor: 'pointer' };

export default SmartPasscode;
